import React, { Fragment } from "react";
import "./ContentHeader.css";
import ContetntItem from "./ContentItem";

const ContentHeader = (props) => {
  const val = Object.values(props);
  // console.log(val);
  return (
    <Fragment>
      {val.map((repo) => {
        if (repo.type === "regular_carousel") {
          return (
            <div>
            <div className="contenet-header">
              <h6 className="contenet-header-text">{`${repo.display_title}`}</h6>
              <a href={repo.configuration.navigation_configuration.url}>
                <button className="contenet-header-btn">مشاهده همه</button>
              </a>
            </div>
            <ContetntItem {...repo}/>
            </div>
          );
        }
      })}
    </Fragment>
  );
};
// ContentHeader.propTypes = {
//   jhanr :PropTypes.string,
//   fullviewulr :PropTypes.string,
//   handelview: PropTypes.func
// };
export default ContentHeader;
